  return (
    <div className=" bg-[#0d0821] text-white">
      <Header />
      <Home />
      <SeparationLine />
      <About />
      <Features />
      <GetStarted />
      <LearnMore />
      <LearnFrom />
      <WhyCrypto />
    </div>
  );
}
